/**
 * @description render elem
 * @author wangfupeng
 */
import Base64 from '../utils/base'
import { h, VNode } from 'snabbdom'
import { DomEditor, IDomEditor, SlateElement } from '@wangeditor/editor'
import { CorrelationElement, ParamsElement } from './custom-types'

function renderCorrelation(
  elem: SlateElement,
  children: VNode[] | null,
  editor: IDomEditor
): VNode {
  const isDisabled = editor.isDisabled()

  // 当前节点是否选中
  const selected = DomEditor.isNodeSelected(editor, elem)

  // 构建 vnode
  const { params = '' } = elem as CorrelationElement
  const base = new Base64()
  const paramsObj = JSON.parse(base.decode(params)) as ParamsElement
  const vnode = h(
    'span',
    {
      props: {
        contentEditable: false, // 不可编辑
        className: 'w-e-correlation',
      },
      style: {
        border:
          selected && !isDisabled
            ? '2px solid var(--w-e-textarea-selected-border-color)' // wangEditor 提供了 css var https://www.wangeditor.com/v5/theme.html
            : '2px solid transparent',
        cursor: isDisabled ? 'pointer' : 'inherit',
      },
      on: {
        // disable 时，点击下载附件
        click() {
          if (!isDisabled) return
          console.log(paramsObj)
          editor.emit('clickCorrelation', paramsObj)
        },
      },
    },
    [
      paramsObj.targetTableName,
      h('img', {
        props: {
          src: 'data:image/png;base64,',
        },
        style: {
          width: '1em',
          marginRight: '0.1em',
          minWidth: '0',
          minHeight: '0',
        },
      }),
    ]
  )

  return vnode
}

const conf = {
  type: 'correlation', // 节点 type ，重要！！！
  renderElem: renderCorrelation,
}

export default conf
